import React from "react";
import Messages from "./Messages/Messages"
import User from "./User/User";
import Friends from "./Friends/Friends";
import Settings from "./Settings/Settings";

const Navbar = () => {
    return (
        <nav className='nav'>
            <User/>
            <hr />
            <Messages/>
            <hr />
            <Friends />
            <hr />
            <Settings />
            <hr />
        </nav>
    );
}

export default Navbar;
